import React, { useEffect, useMemo, useState } from 'react';

// Dependency-free recreation of your Tailwind/Chart.js mock.
// Uses inline styles + lightweight SVG charts to match layout/feel.

/******************** Utilities ********************/
const colors = {
  slate50: '#f8fafc', slate100: '#f1f5f9', slate200: '#e2e8f0', slate300: '#cbd5e1', slate500: '#64748b', slate600: '#475569', slate700: '#334155', slate800: '#1e293b', slate900: '#0f172a',
  blue50: '#eff6ff', blue100: '#dbeafe', blue500: '#3b82f6', blue600: '#2563eb',
  green50: '#ecfdf5', green100: '#d1fae5', green500: '#10b981', green600: '#059669',
  purple50: '#f3e8ff', purple100: '#e9d5ff', purple500: '#8b5cf6', purple600: '#7c3aed',
  indigo50: '#eef2ff', indigo100: '#e0e7ff', indigo500: '#6366f1', indigo600: '#4f46e5',
  yellow50: '#fffbeb', yellow100: '#fef3c7', yellow500: '#f59e0b',
  cyan50: '#ecfeff', cyan100: '#cffafe', cyan500: '#06b6d4',
  red500: '#ef4444'
};

function Card({ children, className, style }: { children: React.ReactNode; className?: string; style?: React.CSSProperties }) {
  return (
    <section
      style={{
        background: '#fff', border: `1px solid ${colors.slate200}`, borderRadius: 16, padding: 24,
        boxShadow: '0 1px 2px rgba(0,0,0,0.04)', ...style
      }}
    >
      {children}
    </section>
  );
}

function Progress({ value, color = colors.blue500 }: { value: number; color?: string }) {
  return (
    <div style={{ height: 8, background: colors.slate200, borderRadius: 4, width: '100%' }}>
      <div style={{ height: 8, width: `${Math.max(0, Math.min(100, value))}%`, background: color, borderRadius: 4 }} />
    </div>
  );
}

function Icon({ name, color, size = 20 }: { name: 'bell'|'user'|'scale'|'activity'|'navigation'|'moon'|'droplet'|'plus'|'upload'|'x'|'award'|'check'|'star'|'clock'|'trending-up'|'trending-down'|'download'|'trash'; color?: string; size?: number }) {
  const stroke = color || colors.slate600;
  const common = { fill: 'none', stroke, strokeWidth: 2, strokeLinecap: 'round' as const, strokeLinejoin: 'round' as const };
  const s = size;
  switch (name) {
    case 'bell': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M15 17h5l-1.4-1.4A2 2 0 0 1 18 14.2V11a6 6 0 1 0-12 0v3.2c0 .5-.2 1-.6 1.4L4 17h5"/><path {...common} d="M9 17a3 3 0 0 0 6 0"/></svg>);
    case 'user': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M20 21a8 8 0 1 0-16 0"/><circle {...common} cx="12" cy="7" r="4"/></svg>);
    case 'scale': return (<svg width={s} height={s} viewBox="0 0 24 24"><circle {...common} cx="12" cy="12" r="9"/><path {...common} d="M12 7v5l3 3"/></svg>);
    case 'activity': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M3 12h4l2-7 4 14 2-7h4"/></svg>);
    case 'navigation': return (<svg width={s} height={s} viewBox="0 0 24 24"><polygon {...common} points="3 11 21 3 13 21 11 13 3 11"/></svg>);
    case 'moon': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M21 12.79A9 9 0 1 1 11.21 3 7 7 0 0 0 21 12.79z"/></svg>);
    case 'droplet': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M12 2.7C12 2.7 5 10 5 14a7 7 0 0 0 14 0c0-4-7-11.3-7-11.3z"/></svg>);
    case 'plus': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M12 5v14M5 12h14"/></svg>);
    case 'upload': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M21 15v4a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2v-4"/><path {...common} d="M17 8l-5-5-5 5"/><path {...common} d="M12 3v12"/></svg>);
    case 'x': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M18 6 6 18M6 6l12 12"/></svg>);
    case 'award': return (<svg width={s} height={s} viewBox="0 0 24 24"><circle {...common} cx="12" cy="8" r="5"/><path {...common} d="M8.5 13.5 7 22l5-3 5 3-1.5-8.5"/></svg>);
    case 'check': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M20 6 9 17l-5-5"/></svg>);
    case 'star': return (<svg width={s} height={s} viewBox="0 0 24 24"><polygon {...common} points="12 2 15 9 22 9 17 14 19 22 12 18 5 22 7 14 2 9 9 9 12 2"/></svg>);
    case 'clock': return (<svg width={s} height={s} viewBox="0 0 24 24"><circle {...common} cx="12" cy="12" r="9"/><path {...common} d="M12 7v6l4 2"/></svg>);
    case 'trending-up': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M3 17l6-6 4 4 7-7"/><path {...common} d="M14 8h7v7"/></svg>);
    case 'trending-down': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M21 7l-6 6-4-4-7 7"/><path {...common} d="M10 14H3V7"/></svg>);
    case 'download': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M21 15v4a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2v-4"/><path {...common} d="M7 10l5 5 5-5"/><path {...common} d="M12 15V3"/></svg>);
    case 'trash': return (<svg width={s} height={s} viewBox="0 0 24 24"><path {...common} d="M3 6h18M8 6l1 14h6l1-14M10 6V4h4v2"/></svg>);
  }
}

function Button({ children, onClick }: { children: React.ReactNode; onClick?: () => void }) {
  return (
    <button onClick={onClick} style={{ padding: '8px 12px', borderRadius: 10, border: `1px solid ${colors.slate200}`, background: colors.blue50, color: colors.blue600, fontSize: 13, cursor: 'pointer' }}>
      {children}
    </button>
  );
}

/******************** Charts ********************/
function LineChart({ labels, series, min, max }: { labels: string[]; series: number[]; min?: number; max?: number }) {
  const width = 520, height = 200, pad = 32;
  const yMin = min ?? Math.min(...series);
  const yMax = max ?? Math.max(...series);
  const toX = (i: number) => pad + (i / Math.max(1, labels.length - 1)) * (width - pad * 2);
  const toY = (v: number) => pad + (1 - (v - yMin) / Math.max(1, (yMax - yMin))) * (height - pad * 2);
  const d = series.map((v, i) => `${i === 0 ? 'M' : 'L'} ${toX(i).toFixed(1)} ${toY(v).toFixed(1)}`).join(' ');
  return (
    <svg width={width} height={height}>
      <line x1={pad} y1={pad} x2={pad} y2={height - pad} stroke={colors.slate300} />
      <line x1={pad} y1={height - pad} x2={width - pad} y2={height - pad} stroke={colors.slate300} />
      {labels.map((l, i) => (
        <text key={i} x={toX(i)} y={height - pad + 14} fontSize={10} textAnchor="middle" fill={colors.slate500}>{l}</text>
      ))}
      <path d={d} fill="none" stroke={colors.blue500} strokeWidth={2} />
    </svg>
  );
}

function Donut({ values, colorsArr, cutout = 0.7, size = 180 }: { values: number[]; colorsArr: string[]; cutout?: number; size?: number }) {
  const total = values.reduce((a, b) => a + b, 0) || 1;
  let start = 0;
  const r = size / 2;
  return (
    <svg width={size} height={size} viewBox={`0 0 ${size} ${size}`}> 
      {values.map((v, i) => {
        const angle = (v / total) * Math.PI * 2;
        const x1 = r + r * Math.cos(start);
        const y1 = r + r * Math.sin(start);
        const x2 = r + r * Math.cos(start + angle);
        const y2 = r + r * Math.sin(start + angle);
        const large = angle > Math.PI ? 1 : 0;
        const d = `M ${r} ${r} L ${x1} ${y1} A ${r} ${r} 0 ${large} 1 ${x2} ${y2} Z`;
        start += angle;
        return <path key={i} d={d} fill={colorsArr[i]} />;
      })}
      <circle cx={r} cy={r} r={r * cutout} fill="#fff" />
    </svg>
  );
}

function Bars({ labels, values, color = colors.purple500 }: { labels: string[]; values: number[]; color?: string }) {
  const width = 360, height = 180, pad = 28;
  const max = Math.max(...values, 1);
  const bw = (width - pad * 2) / values.length - 8;
  return (
    <svg width={width} height={height}>
      <line x1={pad} y1={pad} x2={pad} y2={height - pad} stroke={colors.slate300} />
      <line x1={pad} y1={height - pad} x2={width - pad} y2={height - pad} stroke={colors.slate300} />
      {values.map((v, i) => {
        const h = ((v / max) * (height - pad * 2));
        const x = pad + i * ((width - pad * 2) / values.length) + 4;
        const y = height - pad - h;
        return <rect key={i} x={x} y={y} width={bw} height={h} rx={4} fill={color} />
      })}
      {labels.map((l, i) => (
        <text key={i} x={pad + i * ((width - pad * 2) / labels.length) + 16} y={height - pad + 14} fontSize={10} textAnchor="middle" fill={colors.slate500}>{l}</text>
      ))}
    </svg>
  );
}

/******************** Main Dashboard Component ********************/
