                  <div style={{ marginTop: 8 }}><Progress value={75} color={colors.green500} /></div>
                </div>
                <div style={{ background: colors.yellow50, padding: 16, borderRadius: 12 }}>
                  <p style={{ margin: 0, fontSize: 12, fontWeight: 600, color: '#92400e' }}>Fat</p>
                  <h3 style={{ margin: 0, marginTop: 4, fontSize: 20, fontWeight: 700, color: '#92400e' }}>65g</h3>
                  <p style={{ margin: 0, marginTop: 4, fontSize: 11, color: colors.yellow500 }}>20% of daily intake</p>
                  <div style={{ marginTop: 8 }}><Progress value={60} color={colors.yellow500} /></div>
                </div>
              </div>
              <div style={{ display: 'flex', justifyContent: 'center' }}>
                <Donut values={nutritionValues} colorsArr={[colors.blue500, colors.green500, colors.yellow500]} />
              </div>
            </Card>
          </div>

          {/* Right */}
          <div style={{ display: 'grid', gap: 24 }}>
            {/* Activity */}
            <Card>
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: 12 }}>
                <h2 style={{ margin: 0, fontSize: 16, fontWeight: 600, color: colors.slate800 }}>Activity</h2>
                <button style={{ padding: '6px 10px', borderRadius: 8, background: colors.blue50, color: colors.blue600, border: 'none', fontSize: 12 }}>Today</button>
              </div>
              <div style={{ display: 'grid', gap: 12 }}>
                <div>
                  <div style={{ display: 'flex', justifyContent: 'space-between', fontSize: 13, color: colors.slate600 }}>
                    <p style={{ margin: 0 }}>Steps</p><p style={{ margin: 0 }}>8,742/10,000</p>
                  </div>
                  <div style={{ marginTop: 6 }}><Progress value={87} color={colors.purple500} /></div>
                </div>
                <div>
                  <div style={{ display: 'flex', justifyContent: 'space-between', fontSize: 13, color: colors.slate600 }}>
                    <p style={{ margin: 0 }}>Distance</p><p style={{ margin: 0 }}>6.2/8 km</p>
                  </div>
                  <div style={{ marginTop: 6 }}><Progress value={78} color={colors.blue500} /></div>
                </div>
                <div>
                  <div style={{ display: 'flex', justifyContent: 'space-between', fontSize: 13, color: colors.slate600 }}>
                    <p style={{ margin: 0 }}>Active Minutes</p><p style={{ margin: 0 }}>45/60 min</p>
                  </div>
                  <div style={{ marginTop: 6 }}><Progress value={75} color={colors.green500} /></div>
                </div>
              </div>
              <div style={{ marginTop: 16, display: 'flex', justifyContent: 'center' }}>
                <Bars labels={activityLabels} values={activityValues} color={colors.purple500} />
              </div>
            </Card>

            {/* Wellness */}
            <Card>
              <h2 style={{ margin: 0, fontSize: 16, fontWeight: 600, color: colors.slate800, marginBottom: 12 }}>Wellness</h2>
              <div style={{ display: 'grid', gap: 12 }}>
                <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', padding: 12, background: colors.indigo50, borderRadius: 12 }}>
                  <div style={{ display: 'flex', alignItems: 'center' }}>
                    <div style={{ height: 40, width: 40, background: colors.indigo100, borderRadius: 999, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                      <Icon name="moon" color={colors.indigo600} />
                    </div>
                    <div style={{ marginLeft: 12 }}>
                      <p style={{ margin: 0, fontSize: 13, fontWeight: 600, color: '#3730a3' }}>Sleep Score</p>
                      <p style={{ margin: 0, fontSize: 12, color: colors.indigo600 }}>Last night: 82/100</p>
                    </div>
                  </div>
                  <div style={{ textAlign: 'right' }}>
                    <span style={{ fontSize: 12, fontWeight: 700, color: '#3730a3' }}>Good</span>
                    <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end', marginTop: 4, gap: 4 }}>
                      <Icon name="trending-up" color={colors.green500} size={16} />
                      <span style={{ fontSize: 11, color: colors.green500 }}>+5%</span>
                    </div>
                  </div>
                </div>

                <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', padding: 12, background: colors.green50, borderRadius: 12 }}>
                  <div style={{ display: 'flex', alignItems: 'center' }}>
                    <div style={{ height: 40, width: 40, background: colors.green100, borderRadius: 999, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                      <Icon name="check" color={colors.green600} />
                    </div>
                    <div style={{ marginLeft: 12 }}>
                      <p style={{ margin: 0, fontSize: 13, fontWeight: 600, color: '#065f46' }}>Stress Level</p>
                      <p style={{ margin: 0, fontSize: 12, color: colors.green600 }}>Today: Moderate</p>
                    </div>
                  </div>
                  <div style={{ textAlign: 'right' }}>
                    <span style={{ fontSize: 12, fontWeight: 700, color: '#065f46' }}>3.2/5</span>
                    <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end', marginTop: 4, gap: 4 }}>
                      <Icon name="trending-down" color={colors.red500} size={16} />
                      <span style={{ fontSize: 11, color: colors.red500 }}>-0.8</span>
                    </div>
                  </div>
                </div>

                <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', padding: 12, background: colors.yellow50, borderRadius: 12 }}>
                  <div style={{ display: 'flex', alignItems: 'center' }}>
                    <div style={{ height: 40, width: 40, background: colors.yellow100, borderRadius: 999, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                      <Icon name="clock" color={colors.yellow500} />
                    </div>
                    <div style={{ marginLeft: 12 }}>
                      <p style={{ margin: 0, fontSize: 13, fontWeight: 600, color: '#92400e' }}>Fasting</p>
                      <p style={{ margin: 0, fontSize: 12, color: colors.yellow500 }}>Current: 14h</p>
                    </div>
                  </div>
                  <div style={{ textAlign: 'right' }}>
                    <span style={{ fontSize: 12, fontWeight: 700, color: '#92400e' }}>14/16h</span>
                    <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-end', marginTop: 4, gap: 4 }}>
                      <Icon name="trending-up" color={colors.green500} size={16} />
                      <span style={{ fontSize: 11, color: colors.green500 }}>+2h</span>
                    </div>
                  </div>
                </div>
              </div>
            </Card>

            {/* Achievements */}
            <Card>
              <h2 style={{ margin: 0, fontSize: 16, fontWeight: 600, color: colors.slate800, marginBottom: 12 }}>Achievements</h2>
              <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, minmax(0,1fr))', gap: 12 }}>
                <div style={{ background: colors.blue50, padding: 12, borderRadius: 12, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                  <div style={{ height: 40, width: 40, background: colors.blue100, borderRadius: 999, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                    <Icon name="award" color={colors.blue600} />
                  </div>
                  <p style={{ margin: 0, marginTop: 8, fontSize: 12, fontWeight: 600, color: '#1e40af', textAlign: 'center' }}>7-Day Streak</p>
                </div>
                <div style={{ background: colors.green50, padding: 12, borderRadius: 12, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                  <div style={{ height: 40, width: 40, background: colors.green100, borderRadius: 999, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                    <Icon name="check" color={colors.green600} />
                  </div>
                  <p style={{ margin: 0, marginTop: 8, fontSize: 12, fontWeight: 600, color: '#065f46', textAlign: 'center' }}>Goal Met</p>
                </div>
                <div style={{ background: colors.purple50, padding: 12, borderRadius: 12, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                  <div style={{ height: 40, width: 40, background: colors.purple100, borderRadius: 999, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                    <Icon name="star" color={colors.purple600} />
                  </div>
                  <p style={{ margin: 0, marginTop: 8, fontSize: 12, fontWeight: 600, color: '#6d28d9', textAlign: 'center' }}>New PB</p>
                </div>
              </div>
            </Card>
          </div>
        </div>
      </section>

      {/* Upload History Modal */}
      {showModal && (
        <div style={{ position: 'fixed', inset: 0, background: 'rgba(0,0,0,0.5)', display: 'flex', alignItems: 'center', justifyContent: 'center', zIndex: 50 }}>
          <div style={{ background: '#fff', borderRadius: 16, boxShadow: '0 20px 40px rgba(0,0,0,0.2)', padding: 24, width: 'min(640px, 92vw)', maxHeight: '80vh', overflow: 'auto' }}>
            <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', marginBottom: 12 }}>
              <h3 style={{ margin: 0, fontSize: 18, fontWeight: 700, color: colors.slate800 }}>Upload History</h3>
              <button onClick={() => setShowModal(false)} style={{ border: 'none', background: 'transparent', cursor: 'pointer' }}><Icon name="x" color={colors.slate600} /></button>
            </div>
            <div style={{ display: 'grid', gap: 12 }}>
              {[1,2,3].map((i) => (
                <div key={i} style={{ padding: 16, border: `1px solid ${colors.slate200}`, borderRadius: 12 }}>
                  <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
                    <div>
                      <p style={{ margin: 0, fontWeight: 600, color: colors.slate800 }}>Weight Measurement</p>
                      <p style={{ margin: 0, fontSize: 12, color: colors.slate500 }}>68.5 kg — July 15, 2023</p>
                    </div>
                    <div style={{ display: 'flex', gap: 8 }}>
                      <button style={{ padding: 8, borderRadius: 999, color: colors.blue600, background: colors.blue50, border: 'none', cursor: 'pointer' }}><Icon name="download" color={colors.blue600} size={16} /></button>
                      <button style={{ padding: 8, borderRadius: 999, color: colors.red500, background: '#fee2e2', border: 'none', cursor: 'pointer' }}><Icon name="trash" color={colors.red500} size={16} /></button>
                    </div>
                  </div>
                </div>
              ))}
            </div>
            <div style={{ marginTop: 16 }}>
              <button style={{ width: '100%', padding: '10px 12px', background: colors.blue600, color: '#fff', borderRadius: 8, border: 'none', cursor: 'pointer', display: 'flex', alignItems: 'center', justifyContent: 'center', gap: 8 }}>
                <Icon name="upload" color="#fff" size={16} /> Upload New Results
              </button>
            </div>
          </div>
        </div>
      )}

      <footer style={{ marginTop: 32, padding: 16, textAlign: 'center', color: colors.slate500, fontSize: 12 }}>© {new Date().getFullYear()} vHealth</footer>
    </div>
  );
};

export default Dashboard;
